import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import {
  Freelancer,
  BookmarkJob,
  CreateBookmark,
  FindJobById,
  ListBookmarkedJobs,
  ListJobs,
  JobApplication,
  SkillExperience,
  SkillComponent
} from './FreelancerModule';

const FreelancerRouting = () => (
    <Routes>
      <Route path="/" element={<Freelancer />} />
      <Route path="/bmark/job/listJobs" element={<ListJobs />} />
      <Route path="/freelancer/bmark/job/find/:id" element={<FindJobById />} />
      <Route path="/freelancer/bmark/job/list" element={<ListBookmarkedJobs />} />
      <Route path="/freelancer/bmark/job/add" element={<CreateBookmark />} />
      <Route path="/freelancer/bmark/job/apply/:id" element={<JobApplication />} />
      <Route path="/freelancer/skills" element={<SkillExperience />} />
      <Route path="/freelancer/skill" element={<SkillComponent />} />
    </Routes>
);

export default FreelancerRouting;
